script: |
  super -f text -I q3365.spq | sort > q3365.out

inputs:
  - name: q3365.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 15 NOT IN ( + col0, 51, + 83 + + col2 + + col0 * col1 - - + ( - col1 ), + - col0 );
  - name: tab0

outputs:
  - name: q3365.out
    data: |
      15	81	47
